import React, { useState } from "react";
import '../fw-cuisining.css'; // Relative path from pages folder

const Testing = () => {
  const [modalVisible, setModalVisible] = useState(false);

  const openModal = () => {
    setModalVisible(true);
  };

  const closeModal = () => {
    setModalVisible(false);
  };

  return (
    <>
      <div className="c-container">
        <h1 className="d-flex b-dashed justify-content-center align-items-center d-flex">
          Testing Page
        </h1>

        <div className="d-flex justify-content-center">
          <a href="#" className="cbtn cbtn-primary btn-lg">
            btn-lgasdasdasd
          </a>
        </div>
      </div>
    </>
  );
};

export default Testing;
